import { useEffect, useState } from "react";

const TeacherClassRegister = () => {
    const [classes, setClasses] = useState([]);
    const teacherId = JSON.parse(localStorage.getItem("user"))?.id; // Lấy ID giáo viên từ localStorage
    const [teacherClasses, setTeacherClasses] = useState([]);

    useEffect(() => {
        if (teacherId) {
            fetch(`http://localhost:5000/teacher/classes/${teacherId}`)
                .then(res => res.json())
                .then(data => setTeacherClasses(data))
                .catch(err => console.error("❌ Lỗi khi lấy lịch lớp giáo viên:", err));
        }
    }, [teacherId]);
    const parseSchedule = (scheduleStr) => {
        if (!scheduleStr) return [];
        return scheduleStr.split(",").map(s => {
            const match = s.trim().match(/^(\w+)\s*\(([\d:]+)\s*-\s*([\d:]+)\)$/);
            return match ? {
                day: match[1],
                start: match[2],
                end: match[3],
            } : null;
        }).filter(Boolean);
    };

    const toMinutes = (time) => {
        const [h, m] = time.split(":").map(Number);
        return h * 60 + m;
    };

    const hasScheduleConflict = (newScheduleStr, teacherClassList) => {
        const newSlots = parseSchedule(newScheduleStr);
        for (let cls of teacherClassList) {
            const existingSlots = parseSchedule(cls.schedule);
            for (let newSlot of newSlots) {
                for (let existSlot of existingSlots) {
                    if (
                        newSlot.day === existSlot.day &&
                        toMinutes(newSlot.start) < toMinutes(existSlot.end) &&
                        toMinutes(newSlot.end) > toMinutes(existSlot.start)
                    ) {
                        return true;
                    }
                }
            }
        }
        return false;
    }; const handleRegisterClass = (classId, className, classSchedule) => {
        if (hasScheduleConflict(classSchedule, teacherClasses)) {
            return alert("❌ Bạn đã có lớp trùng lịch học với lớp này!");
        }

        fetch(`http://localhost:5000/teacher/classes/${classId}/assign-teacher`, {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify({ teacher_id: teacherId }),
        })
            .then((res) => res.json())
            .then((data) => {
                alert(`✅ Bạn đã đăng ký dạy lớp ${className} thành công!`);
                setClasses(classes.filter((cls) => cls.id !== classId));
                setTeacherClasses(prev => [...prev, { id: classId, schedule: classSchedule }]); // cập nhật lịch
            })
            .catch((error) => console.error("❌ Lỗi khi đăng ký lớp:", error));
    };


    return (
        <div>
            <h2>Danh sách lớp chưa có giáo viên</h2>
            <table border="1" cellPadding="8" cellSpacing="0">
                <thead>
                    <tr>
                        <th>Tên lớp</th>
                        <th>Trình độ</th>
                        <th>Khối</th>
                        <th>Sĩ số</th>
                        <th>Lịch học</th>
                        <th>Hành động</th>
                    </tr>
                </thead>
                <tbody>
                    {classes.length > 0 ? (
                        classes.map((cls) => (
                            <tr key={cls.id}>
                                <td>{cls.name}</td>
                                <td>{cls.type_mapped}</td>
                                <td>{cls.grade}</td>
                                <td>{cls.current_student}/{cls.max_student}</td>
                                <td>{cls.schedule || "Chưa có lịch"}</td>
                                <td>
                                    <button onClick={() => handleRegisterClass(cls.id, cls.name)}>
                                        Đăng ký dạy
                                    </button>
                                </td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="6" style={{ textAlign: "center" }}>Không có lớp nào cần giáo viên.</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
};

export default TeacherClassRegister;
